function Y = Cy(a,mech, M)

if a > 21

    Y = 0;
    return;

else

    Ynm = 13/183*a - 117/610;
    Ym = 43/560*a - 0.5375;

    if Ynm < 0  
        Ynm = 0;   
    end
    if Ym < 0  
        Ym = 0;  
    end

end

Y = (1 - mech)*Ynm + mech*Ym;

if M > 0.4

    k = -0.3076*M + 1.12304;
    Y = Y*k;

    if M > 0.9
     error("M > 0.9")
    end

end

if Y < 0  
    Y = 0;   
end

function y = CxK(M)

